import { useState, useEffect } from 'react';
import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Context from './components/Context';
import Header from './Header/Header';
import Section from './Section/Section';

function App() {

  const [weatherData, setWeatherData] = useState([])
  const [nameCity, setNameCity] = useState('Madrid')
  const [timeCity, setTimeCity] = useState(null)

  const data = {
    weatherData,
    setWeatherData,
    nameCity,
    setNameCity,
    timeCity,
    setTimeCity
  }

  console.log(timeCity, 'time')

  return (
    <div className="App">
      <BrowserRouter>
        <Context.Provider value={data}>
          <Header />
          <Section />
        </Context.Provider>
      </BrowserRouter>
    </div>
  );
}

export default App;
